import React from "react";
import Header from "../components/Header";
import { Link } from "react-router-dom";

function Home() {
  return (
    <>
      <div className="homepage">
        <Header />
        <center>
          <h1>Music for everyone</h1>
          <h2>millions of songs</h2>
          <div>
            <button>Get Free Music</button>
          </div>
        </center>
      </div>
    </>
  );
}

export default Home;
